  "Sanction Details" : "SUSPENSION OF ONE YEAR FROM ASSOCIATION WITH ANY NASD MEMBER IN ANY CAPACITY, FINED $5,000.00 PLUS DISGORGEMENT FOR A TOTAL AMOUNT OF $12,000.00. THE FINE SHALL BE DUE AND PAYABLE PRIOR TO REASSOCIATION WITH A MEMBER FIRM FOLLOWING THE ONE YEAR SUSPENSION OR PRIOR TO ANY APPLICATION OR REQUEST FOR RELIEF FROM ANY STATUTORY DISQUALIFICATION RESULTING FROM THIS OR ANY OTHER EVENT OR PROCEEDING, WHICHEVER IS EARLIER. SATISFACTORY PROOF OF PAYMENT OF THE DISGORGEMENT SHALL BE A PREREQUISITE EITHER TO REASSOCIATION WITH A MEMBER FIRM FOLLOWING THE ONE YEAR SUSPENSION OR PRIOR TO ANY APPLICATION OR REQUEST FOR RELIEF FROM ANY STATUTORY DISQUALIFICATION RESULTING FROM THIS OR ANY OTHER EVENT OR PROCEEDING, WHICHEVER IS EARLIER. IF FOR ANY REASON RESPONDENT CANNOT LOCATE ANY CUSTOMER IDENTIFIED IN THIS COMPLAINT AFTER REASONABLE AND DOCUMENTED EFFORTS WITH IN SUCH PERIOD OR SUCH ADDITIONAL PERIOD AGREED TO BY THE STAFF, RESPONDENT SHALL FORWARD ANY UNDISTRIBUTED DISGORGEMENT TO THE APPROPRIATE ESCHEAT, UNCLAIMED PROPERTY, OR ABANDONED PROPERTY FUND FOR THE STATE IN WHICH THE CUSTOMER IS LAST KNOWN TO HAVE RESIDED. SUSPENSION EFFECTIVE BEGINING OF BUSINESS NOVEMBER 05, 2001 THROUGH CLOSE OF BUSINESS NOVEMBER 4, 2002."
